import React from "react";
import Drawer from '@material-ui/core/Drawer';
import Button from '@material-ui/core/Button';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import PrintSomething from './home';
import OurStories from '../Stories';

function Menu()
{
    const [state, setState] = React.useState({
      top: false,
      left: false,
      bottom: false,
      right: false,
    });

    const toggleDrawer = (anchor, open) => (event) => {
      if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
      }

      setState({ ...state, [anchor]: open });
    };
  return(

    <div>

    <React.Fragment key={'left'}>
      <Button onClick={toggleDrawer('left', true)}><img src="https://img.icons8.com/ios-filled/50/000000/xbox-menu.png"/></Button>
      <Drawer anchor={'left'} open={state['left']} onClose={toggleDrawer('left', false)} >
       <Router>
          <Button> The Data Anecdotes </Button>
          <Link to="/"><Button>  Home </Button></Link>
          <Link to="/Stories"> <Button> Stories </Button></Link>
          <Link to="/Search"><Button> Search </Button></Link>
          <Link to="/ContactUs"><Button> Contact Us</Button></Link>
          <Switch>
            <Route exact path="/"><PrintSomething/></Route>
            <Route exact path="/Stories"><OurStories/></Route>
            <Route exact path="/Search"></Route>
            <Route exact path="/ContactUs"></Route>
          </Switch>
      </Router>
      </Drawer>
    </React.Fragment>

    </div>
  )
}
export default Menu;
